import React from 'react'


const ExampleV1 = ({text}) => {
    return <h1>{text}</h1>
}

export default ExampleV1

import React from 'react'
// import { ExampleComponentV2 } from 'react-lib-nowports'
import 'react-lib-nowports/dist/index.css'

const ExampleV2 = ({text}) => {
    return <h2>{text}</h2>
}

export default ExampleV2

import React from 'react';
import ExampleV1 from "./components/ExampleComponentV1";
import ExampleV2 from "./components/ExampleComponentV2";

export const ExampleComponent = ({ text }) => {
  return <ExampleV1 text={text} />
}
export const ExampleComponentV2 = ({ text }) => {
  return <ExampleV2 text={text} />
}
